import React from "react";
import "../App.css"; 
export const Contact = () => {
  return (
      <div id="footer" className="footer" style={{display:'flex', alignItems:'center'}}>
        <div className="container text-center" style={{display:'flex', alignItems:'center', justifyContent}}>
          <p>
            &copy; 2024 Test Tuzuvchi. Design by "Mutolaa Suniy idrok"
          </p>
        </div>
      </div>
  );
};
